tradingependuser: title : iex cloud api
description :
      iex cloud is the next generation of iex’s api platform. iex cloud allows you to access real-time and historical data from the iex exchange and iex cloud. iex cloud is available to all users for free, with no api keys or authentication required. the iex cloud api is restful and uses json for all data responses. the api is versioned, so you can always be sure that the latest version is available. the api is also documented in openapi format.
endpoints :
    - get /tops/{symbol}
      get the top of book for a given symbol
    - get /tops/{symbol}/level/{level}
      get the top of book for a given symbol and level
    - get /tops/{symbol}/size/{size}
      get the top of book for a given symbol and size
    - get /tops/{symbol}/size/{size}/level/{level}
      get the top of book for a given symbol, size, and level
    - get /tops/{symbol}/size/{size}/level/{level}/type/{type}
      get the top of book for a given symbol, size, level, and type
    - get /tops/{symbol}/size/{size}/level/{level}/type/{type}/time
      get the top of book for a given symbol, size, level, type, and time
    - get /tops/{symbol}/size/{size}/level/{level}/type/{type}/time/{time}
      get the top of book for a given symbol, size, level, type, time, and time
    - get /tops/{symbol}/size/{size}/level/{level}/type/{type}/time/{time}/price/{price}
      get the top of book for a given symbol, size, level, type, time, price, and price
    - get /tops/{symbol}/size/{size}/level/{level}/type/{type}/time/{time}/price/{price}/volume
      get the top of book for a given symbol, size, level, type, time, price, price, and volume
    - get /tops/{symbol}/size/{size}/level/{level}/type/{type}/time/{time}/price/{price}/volume/{volume}
      get the top of book for a given symbol, size, level, type, time
